CREATE TABLE books (
    bookID	INT,
    title	VARCHAR(512),
    authors	VARCHAR(1024),
    average_rating	FLOAT,
    isbn	VARCHAR(10),
    isbn13	BIGINT,
    language_code	VARCHAR(512),
    num_pages	INT,
    ratings_count	INT,
    text_reviews_count	INT,
    publication_date	VARCHAR(512),
    publisher	VARCHAR(512), 
    PRIMARY KEY (bookID)
);

